."]},{"cell_type":"code","execution_count":14,"id":"0a4199a2","metadata":{"execution":{"iopub.execute_input":"2022-06-09T23:24:58.762135Z","iopub.status.busy":"2022-06-09T23:24:58.760493Z","iopub.status.idle":"2022-06-09T23:24:58.774901Z","shell.execute_reply":"2022-06-09T23:24:58.773321Z"},"papermill":{"duration":0.028183,"end_time":"2022-06-09T23:24:58.777388","exception":false,"start_time":"2022-06-09T23:24:58.749205","status":"completed"},"tags":[]},"outputs":[],"source":["g4 <- (g1+g2 + plot_layout(widths = c(1, 2)))/g3"]},{"cell_type":"markdown","id":"097dd720","metadata":{"papermill":{"duration":0.010221,"end_time":"2022-06-09T23:24:58.796875","exception":false,"start_time":"2022-06-09T23:24:58.786654","status":"completed"},"tags":[]},"source":["Now let us create empty plots that contain just the sum of the different attributes. They will give more details to the dashboard."]},{"cell_type":"code","execution_count":15,"id":"e052f969","metadata":{"execution":{"iopub.execute_input":"2022-06-09T23:24:58.819194Z","iopub.status.busy":"2022-06-09T23:24:58.817693Z","iopub.status.idle":"2022-06-09T23:24:58.849211Z","shell.execute_reply":"2022-06-09T23:24:58.847559Z"},"papermill":{"duration":0.044731,"end_time":"2022-06-09T23:24:58.851116","exception":false,"start_time":"2022-06-09T23:24:58.806385","status":"completed"},"tags":[]},"outputs":[],"source":["#Create a blank theme (that permits border and color)\n","theme <- theme(axis.text.y   = element_blank(),\n","      axis.text.x   = element_blank(),\n","      axis.title.y  = element_blank(),\n","      axis.title.x  = element_blank(),\n","      panel.background = element_blank(),\n","      panel.grid.major = element_blank(), \n","      panel.grid.minor = element_blank(),\n",")\n","\n","#Population\n","g5 <- ggplot() +\n","  annotate(\"text\", x = 10,  y = 10,\n","           size = 6,\n","           label = sum(continents$Population)) + \n","  labs(\n","    title = \"World Population\",       # plot title\n","  ) +\n","  theme +\n","  theme(plot.background = element_rect(colour = \"black\", fill=\"coral1\", size=1))\n","\n","#Total Cases\n","g6 <- ggplot() +\n","  annotate(\"text\", x = 10,  y = 10,\n","           size = 6,\n","           label = sum(continents$`Total Cases`)) + \n","  labs(\n","    title = \"Total Cases\",       # plot title\n","  ) +\n","  theme +\n","  theme(plot.background = element_rect(colour = \"black\", fill=\"darkgoldenrod\", size=1))\n","\n","#Active Cases\n","g7 <- ggplot() +\n","  annotate(\"text\", x = 10,  y = 10,\n","           size = 6,\n","           label = sum(continents$`Active Cases`)) + \n","  labs(\n","    title = \"Active Cases\",       # plot title\n","  ) +\n","  theme +\n","  theme(plot.background = element_rect(colour = \"black\", fill=\"chartreuse4\", size=1))\n","\n","#Deaths\n","g8 <- ggplot() +\n","  annotate(\"text\", x = 10,  y = 10,\n","           size = 6,\n","           label = sum(continents$Deaths)) + \n","  labs(\n","    title = \"Deaths\",       # plot title\n","  ) +\n","  theme +\n","  theme(plot.background = element_rect(colour = \"black\", fill=\"deepskyblue\", size=1))"]},{"cell_type":"markdown","id":"2dc95e71","metadata":{"papermill":{"duration":0.009696,"end_time":"2022-06-09T23:24:58.87018","exception":false,"start_time":"2022-06-09T23:24:58.860484","status":"completed"},"tags":[]},"source":["And now, let us see the magic that we have created."]},{"cell_type":"code","execution_count":16,"id":"6ce217fc","metadata":{"execution":{"iopub.execute_input":"2022-06-09T23:24:58.892899Z","iopub.status.busy":"2022-06-09T23:24:58.891494Z","iopub.status.idle":"2022-06-09T23:25:00.016412Z","shell.execute_reply":"2022-06-09T23:25:00.014813Z"},"papermill":{"duration":1.139417,"end_time":"2022-06-09T23:25:00.019762","exception":false,"start_time":"2022-06-09T23:24:58.880345","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAB4AAAAPACAIAAABb1/PuAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ3wUVdsG